import React from 'react';
import bakimage from '../back_image.jpg'
function Home() {
    return (
        <>
            <div id="cont">
                <img src={bakimage} alt="teri" />
                </div>
            <div className="container">
                <h1>Welcome to the Application!</h1>
            </div>
        </>
    );
}

export default Home;
